import React,{useState} from "react";
import {StyleSheet,View,Text,TextInput,Button} from "react-native";
import {Formik} from "formik";
import * as yup from"yup";
import {RadioButton} from "react-native-paper";
const ReviewSchema=yup.object({
    fullname:yup.string().required().min(2).max(10),
    emailid:yup.string().required(),

});
export default function UserDetails({navigation})
{
  const [userDetails,setuserDetails]=useState({'fullname':'','emailid':'','gender':1});
  const [value, setValue] = React.useState(1); 



  const onSubmitHandler=(val)=>{
      setuserDetails({
        'fullname':val.fullname,
        'emailid':val.emailid,
        'gender':value
      })
      let gender="O"
        if(value===1)
          gender="F";
        if(value===2)
          gender="M"
        console.log(navigation.state.params);
        console.log("going to other page");
        navigation.push('Location',{"phone_number":navigation.state.params.phone_number,
        "type":navigation.state.params.value,"fullname":val.fullname,"emailid":val.emailid,
        "gender":gender});
    }


    return (
      <View style={styles.container}>
        <View style={styles.container1}></View>
        <View style={styles.container2}><Text style={styles.headertext}>Your Details</Text></View>
        <Formik initialValues={{fullname:'',emailid:''}} validationSchema={ReviewSchema} onSubmit={(values,actions)=>{actions.resetForm();}}>
          {(props)=>(
            <View >
              <Text style={styles.registerheading}>Enter Full Name</Text>
              <TextInput style={styles.registerip} placeholder='Enter Full Name' value={props.values.fullname} onChangeText={props.handleChange('fullname')}/>
              <Text>{props.touched.fullname && props.errors.fullname}</Text>
              <Text style={styles.registerheading}>Email Id</Text>
              <TextInput style={styles.registerip} placeholder='Email Id' value={props.values.emailid} onChangeText={props.handleChange('emailid')}/>
              <Text>{props.touched.emailid && props.errors.emailid}</Text>
                <RadioButton.Group onValueChange={newValue => setValue(newValue)} value={value} >
                  <View style={styles.radio}>
                    <View style={styles.radio1}>
                      <RadioButton color="#FC8019" title="scasc1"value={1} />
                      <Text style={styles.registerradioip}>Female</Text>
                    </View>
                    <View style={styles.radio1}>
                      <RadioButton color="#FC8019" value={2} />
                      <Text style={styles.registerradioip}>Male</Text>
                    </View>
                    <View style={styles.radio1}>
                      <RadioButton value={3} />
                      <Text style={styles.registerradioip}>Other</Text>
                    </View>
                  </View>
                </RadioButton.Group>
                <Button color="#F57503"  title="CONTINUE" onPress={()=>{props.handleSubmit();onSubmitHandler(props.values)}}/>
              </View>
            )}
        </Formik>
        <Button title="next"   onPress={()=>{navigation.push('Location')}}/>
      </View>
    )
}
const styles = StyleSheet.create({
  registerradioip:{
    fontSize:14,
  },
  header:
  {
    backgroundColor:"#F57503",
    alignItems:"center",
    width:'100%',
    height:56,
  },
  headertext:{
    alignItems:"center",
    fontSize:16,
  },
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    radio:{
      flexDirection:'row',
    },
    radio1:{
      flexDirection:'row'
    },
    registerip:{
      borderColor:"#FC8019",
      borderWidth:1.5,
    }
    ,
    registerheading:
    {
      fontSize:12,
      fontWeight:'700',

    },
  });
